create table questionnaire_info
(
    id                        varchar(50)  not null comment '问卷id'
        primary key,
    questionnaire_name        varchar(100) not null comment '问卷名称',
    questionnaire_description text         null comment '问卷说明',
    created_by                char(32)     not null comment '创建人员',
    creation_date             datetime     not null comment '创建时间',
    project_id                varchar(50)  not null comment '所属项目id',
    type                      int          not null comment '调查类型(枚举值)',
    start_time                datetime     not null comment '问卷开始时间',
    end_time                  datetime     not null comment '问卷结束时间',
    publish_time              datetime     null comment '问卷发布时间',
    status                    tinyint      not null comment '问卷状态，是否启用'
);

